import { BrowserRouter } from 'react-router-dom'
import Routes from './routes'; // chamdno o index.js de routes
import AutthProvider from './contexts/auth'

function App() {
  return (
    <AutthProvider>
       <BrowserRouter>
          <Routes/>
       </BrowserRouter>
    </AutthProvider>
  );
}

export default App;
